DROP DATABASE IF EXISTS sakilav2;

CREATE DATABASE sakilav2;

USE sakilav2;

/* Creates the FILM table. For information on data types, see https://dev.mysql.com/doc/refman/8.0/en/data-types.html */

CREATE TABLE film (
  filmID INT,
  title VARCHAR(255) NOT NULL,
  description VARCHAR(1000),
  releaseYear SMALLINT,
  length SMALLINT UNSIGNED,
  replacementCost DECIMAL(5,2) NOT NULL DEFAULT 19.99,
  rating VARCHAR(5) NOT NULL,
  CONSTRAINT film_pk PRIMARY KEY (filmID),
  CONSTRAINT film_replacementCost_ck CHECK (replacementCost > 9.99)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



